import React from 'react';
import { Link } from 'react-router-dom';
export {SignUp} from './components/SignUp';

const SignUp = () => {
  return (
    <div>
      <h1>Welcome to SignUp</h1>
      <Link to="/login" className="btn btn-primary">Login</Link>
    </div>
  );
};

export default SignUp;
